import React, { Component } from "react";
import Card from "pnnl-react-core/lib/Card";
import Grid from "react-bootstrap/es/Grid";
import Row from "react-bootstrap/es/Row";
import Col from "react-bootstrap/es/Col";
import CVGPlot from "../Plots/CVGPlot";
import LHSPlot from "./Plots/LHSPlot";
import LCSPlot from "./Plots/LCSPlot";
import Pdf from "react-to-pdf";
const ref = React.createRef();
const options = {
  orientation: "landscape",
  unit: "px",
  format: [1080, 1080]
};

export class Intermediate extends Component {
  constructor(props) {
    super(props);
    this.tm30 = this.props.tm30; //The data from the JSON file
    this.input = this.props.input;
  }
  holder(num) {
    return { height: num };
  }
  render() {
    return (
      <div>
        {" "}
        <Row>
          <Col xs={12} md={7}></Col>
          <Col xs={12} md={5}>
            <Card>
              <div style={this.holder(400)}>
                <LCSPlot
                  data={this.tm30.Numerical_Results.local_chroma_shift}
                ></LCSPlot>
              </div>
            </Card>
          </Col>
        </Row>
        <br />
        <Row>
          <Col xs={12} md={7}>
            <Card>
              <CVGPlot
                xtest={
                  this.props.location.state.data.tm30.Numerical_Results
                    .path_xtest
                }
                ytest={
                  this.props.location.state.data.tm30.Numerical_Results
                    .path_ytest
                }
                xref={
                  this.props.location.state.data.tm30.Numerical_Results
                    .path_xref
                }
                yref={
                  this.props.location.state.data.tm30.Numerical_Results
                    .path_yref
                }
                rf={this.props.location.state.data.tm30.Numerical_Results.rg}
                rg={this.props.location.state.data.tm30.Numerical_Results.rf}
                cct={
                  this.props.location.state.data.tm30.Numerical_Results.CCT[0]
                }
                duv={
                  this.props.location.state.data.tm30.Numerical_Results.DUV[0]
                }
              ></CVGPlot>
            </Card>
          </Col>
          <Col xs={12} md={5}>
            <Card>
              <div style={this.holder(400)}>
                <LHSPlot
                  data={
                    this.props.location.state.data.tm30.Numerical_Results
                      .local_hue_shift
                  }
                ></LHSPlot>
              </div>
            </Card>
          </Col>
        </Row>
      </div>
    );
  }
}

export default Intermediate;
